// Fun√ß√£o para converter string "DD/MM/YYYY HH:MM" para objeto Date
function parseDateOnly(dateTimeStr) {
  if (!dateTimeStr) return null;
  const parts = dateTimeStr.split(' ')[0].split('/'); // pega apenas DD/MM/YYYY
  if (parts.length !== 3) return null;
  const day = parseInt(parts[0], 10);
  const month = parseInt(parts[1], 10) - 1; // meses em JS v√£o de 0 a 11
  const year = parseInt(parts[2], 10);
  return new Date(year, month, day);
}

// Fun√ß√£o para extrair apenas o n√∫mero do ID, removendo prefixos como "Caso ID :" ou "Case ID :"
function extractCaseId(idStr) {
  if (!idStr) return null;
  return idStr.replace(/(Caso|Case)\s*ID\s*:\s*/i, '').trim();
}

// Recupera todos os e-mails e links correspondentes
const emailItems = $('Search Emails').all();
const linkItems = $('search for an element in the email body').all();

// Percorre todos os itens de entrada
const results = [];
const inputItems = $input.all();

for (let i = 0; i < inputItems.length; i++) {
  const item = inputItems[i];
  const birthDateStr = item.json.dtnasc;
  const requestDateTimeStr = item.json.data_solicitacao;
  const rawId = item.json.id;

  // Tratamento do ID
  const caseId = extractCaseId(rawId);

  // Captura o subject e o link correspondentes (mesmo √≠ndice)
  const emailSubject = emailItems[i]?.json?.headers?.subject || null;
  const emailLink = linkItems[i]?.json?.dados || null;

  // Determina o tipo de atendimento com base no subject
  let attendanceType = "PRESENCIAL";
  if (emailSubject && emailSubject.toLowerCase().includes("tele-medicine")) {
    attendanceType = "TELEMEDICINA";
  }

  // Se faltar algum dado essencial, apenas devolve o item como est√°
  if (!birthDateStr || !requestDateTimeStr) {
    results.push({
      json: {
        ...item.json,
        caseId: caseId || null,
        emailSubject: emailSubject,
        attendanceType: attendanceType,
        link: emailLink
      }
    });
    continue;
  }

  const birthDate = parseDateOnly(birthDateStr);

  // Separar data e hor√°rio
  const [datePart, timePart] = requestDateTimeStr.split(' '); // "DD/MM/YYYY" e "HH:MM"
  const requestDate = parseDateOnly(datePart);

  if (!birthDate || !requestDate) {
    results.push({
      json: {
        ...item.json,
        caseId: caseId || null,
        emailSubject: emailSubject,
        attendanceType: attendanceType,
        link: emailLink
      }
    });
    continue;
  }

  // Calcula a idade
  let age = requestDate.getFullYear() - birthDate.getFullYear();
  const m = requestDate.getMonth() - birthDate.getMonth();
  if (m < 0 || (m === 0 && requestDate.getDate() < birthDate.getDate())) {
    age--;
  }

  // Retorna o item completo com todos os campos tratados
  results.push({
    json: {
      ...item.json,
      age: age,
      requestDate: datePart,    // apenas a data
      requestTime: timePart,    // apenas o hor√°rio
      caseId: caseId,           // n√∫mero do caso limpo
      emailSubject: emailSubject, // texto do subject do e-mail
      attendanceType: attendanceType, // "TELEMEDICINA" ou "PRESENCIAL"
      link: emailLink           // link correspondente ao e-mail
    }
  });
}

return results;
